import React, { Component } from 'react'

export default class Navbar extends Component {
   render() {
      return (
         <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
            <div class="container">
               <a class="navbar-brand" href="#">GhOSt_BI</a>
            </div>
         </nav>
      )
   }
}
